import React, { Component } from 'react';
import Head from 'next/head';
import example from '../example';
import SideMenu from '../SideMenu';
import Header from '../Header.js';
export default class mainSite extends Component {
	constructor(props) {
		super(props);
		this.state = { hamburger: false };
	}
	render() {
		return (
			<div className="container" id="outer-container" style={{ left: this.state.hamburger ? '200px' : '0px' }}>
				<Head>
					<link href="/styles.css" rel="stylesheet" />
					<title>Cancelled Toronto</title>
				</Head>
				<Header />
				<SideMenu />
				<div
					onClick={() => {
						this.setState({ hamburger: this.state.hamburger ? false : true });
					}}
				>
					'hahahxd' {this.state.hamburger.toString()}
				</div>
				{this.props.children}
			</div>
		);
	}
}
